(51, 'Donne-moi la moyenne des concentrations d’uranium et de vanadium pour chaque lithologie', 0, '2025-05-12 19:26:05.059089', 7),
(52, 'Voici les moyennes des concentrations d\'uranium et de vanadium pour chaque lithologie :\n\n* Granite : Uranium 91.5, Vanadium 122.8\n* Calcaires silicatés : Uranium 139.2, Vanadium 221.7\n* Colluvions : Uranium 141.1, Vanadium 144.2\n* Alluvions : Uranium 25.6, Vanadium 30.5\n* Calcrètes : Uranium 32.4, Vanadium 48.8\n* Graviers : Uranium 30.3, Vanadium - Aucune donnée\n* Saprolites : Uranium 16.4, Vanadium - Aucune donnée\n* Grès : Uranium 16.0, Vanadium - Aucune donnée\n* Roches mafiques : Uranium 283.3, Vanadium - Aucune donnée\n* Syénites : Uranium 81.4, Vanadium - Aucune donnée\n* Sédiments : Uranium 23.0, Vanadium - Aucune donnée\n* Sables : Uranium 193.6, Vanadium - Aucune donnée\n\n\nLes valeurs sont exprimées en unités non spécifiées.  Notez qu\'il manque des données de vanadium pour plusieurs lithologies.', 1, '2025-05-12 19:26:09.700870', 7),
